package mypackage;

public class If_Else_If {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		
		int a=100;
		int b=200;
		int c=300;
		if(a<b)
		{
			System.out.println("One");
		}
		
		else if(b<c)
		{
			System.out.println("Two");
		}
		else
		{
			System.out.println("Three");
		}
	}

}
